    onLoad: function (options) {
        const self = this;
        if(options.id){
            self.setData({
                optionsgGoodId: options.id
            })
        }
        const shopCarList = wx.getStorageSync('shopCar');
        let num = 0;
        for (const item of shopCarList) {
            num += item.buyNumber;
        }
        wx.request({
            url: app.globalData.url + `/goodImpl/goodInfo?GOOD_ID=${this.data.optionsgGoodId}&USER_ID=${app.globalData.userInfo.USER_ID}`,
            // url: app.globalData.url + `/goodImpl/goodInfo?GOOD_ID=${options.id}&USER_ID=26`,
            method: "GET",
            success: function (res) {
                if (res.statusCode == 200) {
                    if (res.data.goodInfo.VIDEO_PATH != '' && res.data.goodInfo.VIDEO_PATH != null) {
                        // res.data.goodInfo.VIDEO_IMG = 'http://img0.imgtn.bdimg.com/it/u=1625823568,348098948&fm=26&gp=0.jpg';
                        res.data.goodInfo.VIDEO_PATH = app.globalData.url + '' + res.data.goodInfo.VIDEO_PATH
                        res.data.goodInfo.IMAGES_LIST.unshift({
                            PATH: app.globalData.url + '' + res.data.goodInfo.VIDEO_IMG_PATH,
                            isVideo: true
                        })
                        self.setData({
                            goodsDetail: res.data.goodInfo,
                            isVideo: true,
                            shopNum: num
                        })
                    } else {
                        self.setData({
                            goodsDetail: res.data.goodInfo,
                            shopNum: num
                        });
                    }
                }
            }
        });
        wx.request({
            url: app.globalData.url + `/goodImpl/goodCommentList?GOOD_ID=${options.id}&USER_ID=${app.globalData.userInfo.USER_ID}`,
            method: "GET",
            success: function (res) {
                self.setData({
                    commentList: res.data.commentList
                });
                // commentList
            }
        });
        //
    },
    getShopNum: function () {
        let num = 0;
        const shopCarList = wx.getStorageSync('shopCar');
        for (const item of shopCarList) {
            num += item.buyNumber;
        }
        ;
        this.closePopupTap();
        this.setData({
            shopNum: num
        });
    },
    onReady: function () {
        this.videoContext = wx.createVideoContext('myVideo');
    },
    // isMemberShipStatus
    isMembership: function () {
        const self = this;
        return new Promise(function (resolve, reject) {
            if (!app.globalData.userInfo.PHONE || app.globalData.userInfo.PHONE == '') {
                self.setData({
                    isMemberShipStatus: false,
                    hideShopPopup: true
                })
                resolve(200)
            } else {
                resolve(400)
            }
        })
    },
    confirmMemberShip: function () {
        wx.redirectTo({
            url: '/pages/register/register',
        });
    },
    addShopCar: function () {
        const self = this;
        this.isMembership().then(res => {
            if (res == 200) {
                return false;
            }
            let shopCar = [];
            let isNewShop = false;
            shopCar.push({
                goodsDetail: this.data.goodsDetail,
                buyNumber: this.data.buyNumber,
                active: true
            });
            const shopCarList = wx.getStorageSync('shopCar');
            for (const item of shopCarList) {
                if (item.goodsDetail.USER_ID == shopCar[0].goodsDetail.USER_ID) {
                    shopCar[0].buyNumber += item.buyNumber;
                    isNewShop = true;
                    break;
                }
            }
            if (!isNewShop && shopCarList != '') {
                shopCar = shopCar.concat(shopCarList);
            }
            wx.setStorage({
                key: 'shopCar',
                data: shopCar,
                success: function (res) {
                    self.getShopNum();
                    if (res.errMsg == "setStorage:ok") {
                        wx.showToast({
                            title: '加入购物车成功',
                            icon: 'success',
                            duration: 2000
                        })
                    }
                }
            })
        });
    },
    tobuy: function () {
        this.setData({
            isShoping: true
        })
    },
    buyNow: function () {
        this.isMembership().then(res => {
            if (res == 200) {
                return false;
            }
            wx.navigateTo({
                url: `/pages/to-pay-order/index?goodId=${this.data.goodsDetail.USER_ID}&num=${this.data.buyNumber}`
            })
        })
    },
    videorequestFullScreen() {
        this.videoContext.play();
        this.videoContext.requestFullScreen({
            direction: 0
        });
    },
